atom-text-editor {
  background-color: #31343f;
  color: #dee2f7;
}
atom-text-editor .line.cursor-line {
  background-color: rgba(153, 170, 255, 0.04);
}
atom-text-editor .invisible {
  color: #dee2f7;
}
atom-text-editor .cursor {
  border-left: 2px solid #8599ff;
}
atom-text-editor .selection .region {
  background-color: #484b5b;
}
atom-text-editor .bracket-matcher .region {
  border-bottom: 1px solid #8599ff;
  box-sizing: border-box;
}
atom-text-editor .invisible-character {
  color: rgba(222, 226, 247, 0.1);
}
atom-text-editor .indent-guide {
  color: rgba(222, 226, 247, 0.1);
}
atom-text-editor .wrap-guide {
  background-color: rgba(222, 226, 247, 0.1);
}
atom-text-editor .find-result .region.region.region,
atom-text-editor .current-result .region.region.region {
  border-radius: 2px;
  background-color: rgba(133, 153, 255, 0.24);
  transition: border-color 0.4s;
}
atom-text-editor .find-result .region.region.region {
  border: 2px solid transparent;
}
atom-text-editor .current-result .region.region.region {
  border: 2px solid #8599ff;
  transition-duration: .1s;
}
atom-text-editor .gutter .line-number {
  color: #63677e;
  -webkit-font-smoothing: antialiased;
}
atom-text-editor .gutter .line-number.cursor-line {
  color: #dee2f7;
  background-color: #363845;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection {
  background-color: transparent;
}
atom-text-editor .gutter .line-number .icon-right {
  color: #dee2f7;
}
atom-text-editor .gutter:not(.git-diff-icon) .line-number.git-line-removed.git-line-removed::before {
  bottom: -3px;
}
atom-text-editor .gutter:not(.git-diff-icon) .line-number.git-line-removed::after {
  content: "";
  position: absolute;
  left: 0px;
  bottom: 0px;
  width: 25px;
  border-bottom: 1px dotted rgba(224, 82, 82, 0.5);
  pointer-events: none;
}
atom-text-editor .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
atom-text-editor .fold-marker:after {
  color: #dee2f7;
